function setPads(str)
{
    var b64 = new Map("0123456789ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz_-".split("").map((c,i)=>[c,i]));
    var hexmap = "0123456789abcdef".split("");
    function decgid(s)
    {
        if(s[0]!="#")return s;
        var t = s.substr(1).match(/.{1,2}/g).map(s=>hexmap[b64.get(s[0])>>2] + hexmap[((b64.get(s[0])&3)<<2) + (b64.get(s[1])>>4)] + hexmap[b64.get(s[1])&15]).join("");
        return t.substr(0,8)+"-"+t.substr(8,4)+"-"+t.substr(12,4)+"-"+t.substr(16,4)+"-"+t.substr(20,12);
    }
    return str.replace(/\#/g,"&#").split("&").map(t=>t.split("@")).map(t=>{var d = new Date(); d.setTime(parseInt(t[2],36));return {"padGroupId":decgid(t[0]),"padName":t[1],"owner":{"fullname":"Mathnasium@Burbank"},"createDate":d.toISOString()}}).filter(t=>t.padName);
}
window.pads = setPads(window.pads);

window.updatePads = function(str)
{
    var newPads = setPads(str);
    newPads.reverse();
    newPads.forEach(p => (!window.pads.find(w => w.padGroupId == p.padGroupId) ? window.pads.unshift(p) : 0));
}
window.breakoutRooms = [];
window.streamDatas = [];
window.unassignables = [];



window.promptBox = function(html, callback)
{
    var width = 500;
    var p = document.createElement("div");
    p.id = "custompromptbox";
    p.style = "position:absolute;top:0px;width:"+width+"px;background:white;z-index:1000000;padding:6px;border:1px solid grey;text-align:center;box-shadow:5px 10px #00000040;font-size:16pt";
    var inner = document.createElement("div");
    inner.style = "padding:4px;text-align:center";
    inner.innerHTML = html + "<br><br>";
    p.appendChild(inner);
    var b1 = document.createElement("button");
    b1.onclick = window.promptBoxCancel;
    b1.innerText = "Cancel";
    b1.style = "width:48%;height:25px;border:2px solid black;background:white;font-size:20px";
    b1.style.float = "left";
    var b2 = document.createElement("button");
    b2.onclick = window.promptBoxConfirm;
    b2.innerText = "Okay";
    b2.style = "width:48%;height:25px;border:2px solid black;background:white;font-size:20px";
    b2.style.float = "right";
    p.appendChild(b2);
    p.appendChild(b1);
    p.style.left = (window.innerWidth/2 - width/2) + "px";
    window.promptBoxOkay = callback||function(){};
    var d = document.createElement("div");
    d.style = "position:absolute;left:0px;top:0px;width:100%;height:100%;z-index:999999;background:#000000;opacity:0.38";
    d.onclick = window.promptBoxCancel;
    d.id = "custompromptboxbg";
    document.body.appendChild(d);
    document.body.appendChild(p);
    var inps = Array.from(inner.getElementsByTagName("input"));
    inps.filter(t=>t.type == "text"&&t.size == 20).forEach(t=>t.size = 64);
    if(inps.length > 0) inps[0].focus(), inps[0].addEventListener("keydown",function(e){if(e.key=="Enter")window.promptBoxConfirm()});
    return inner;
};
window.promptBoxOkay = {};
window.promptBoxCancel = function()
{
    document.getElementById("custompromptbox").remove();
    document.getElementById("custompromptboxbg").remove();
};
window.promptBoxConfirm = function()
{
    window.promptBoxOkay();
    window.promptBoxCancel();
};

window.deleteExpiredRooms = function()
{
    var rs = window.utils.getRooms();
    rs.forEach(r => {
        if(r.isExpired()&&!r.hasStudentsOnline())
        {
            if(window.occupiedList.includes(r.name))
            {
                console.log("Deleting: ",r.name," null");
                r.users.forEach(p => window.removeUser(p.id,r.id));
                window.deleteRoom(r.id);
            }
            else
            {
                console.log("Renaming " + r.name);
                r.users.forEach(p => window.removeUser(p.id,r.id));
                window.renameRoom(r.id,"NO SHOW " + r.name);
                r.noShow = true;
            }
        }
    });
}
window.putById = function(id)
{
    return false;
    var success = false;
    var rs = window.utils.getRooms().filter(r => r.isActiveRoom());
    var unassigned = window.participants
        .filter(p => p.id == id)
        .map(u => ({id:u.id, names:window.userInfo.getAltNames(u)}));
    if(unassigned.length == 0)return;
    ["main","mainnick","sibling","siblingnick"].forEach(n => {
        unassigned.forEach(u => {
            if(u.room||!u.names[n])return;
            var shortName = u.names[n].match(/[A-Z][a-z]+/);
            if(!shortName) shortName = [u.names[n]];
            var poss = rs.filter(r => r.student.indexOf(shortName[0])!=-1);
            if(poss.length == 1)
                console.log("Assigned " + shortName[0] + " to " + poss[0].name),
                window.assignUserGlobal(u.id,poss[0].id), u.room = poss[0].id, success = true;
            else
                console.log("Could not assign " + shortName[0] + ": ", poss);
        });
    });
    return success;
}
window.autoAssignStudents = function(wasassignedstr)
{
    var unassigned = window.participants.filter(p => !window.userInfo.isMod(p) && p.isOnline && (!p.room || window.userInfo.inWaitingRoom(p)));
    if(unassigned.length == 0) return wasassignedstr;
    var wasassigned = wasassignedstr.split(",");
    var rs = window.utils.getRooms().filter(r => r.isActiveRoom() && r.time.getMinutesElapsed() >= -12);
    unassigned = unassigned.filter(p => !wasassigned.includes(p.id))
        .map(u => ({id:u.id, names:window.userInfo.getAltNames(u)}));
    ["main","mainnick","sibling","siblingnick"].forEach(n => {
        unassigned.forEach(u => {
            if(u.room||!u.names[n])return;
            var poss = rs.filter(r => r.student.indexOf(u.names[n])!=-1);
            if(poss.length == 1)
                console.log("Assigned " + u.names[n] + " to " + poss[0].name),
                window.assignUserGlobal(u.id,poss[0].id), u.room = poss[0].id, wasassigned.push(u.id);
            else
                console.log("Could not assign " + u.names[n] + ": ", poss);
        });
    });
    return wasassigned.join(",");
}

window.listNoShows = function()
{
    return window.utils.getRooms().filter(r => r.isActiveRoom() && !r.hasStudents() && r.time.isPassed() && !r.endTime.isPassed()).map(r => r.id);
}

window.roomWBPromptId = function(id)
{
    var authToken = window.location.href;
    authToken = authToken.substring(authToken.indexOf("&auth_token="));
    var r = window.breakoutRooms.filter(function(b){ return b.id==id });
    if(r.length == 1)
    {
        var t = window.prompt("Give the name for whiteboards to put in " + r[0].name + ":")||r[0].name.split(" ")[2], t = t.toLowerCase();
        var p = window.pads.filter(function(b){ return b.padName.toLowerCase().indexOf(t)!=-1});
        if(p.length > 0)
        {
            var tstr = "";
            for(var i = 0; i < p.length; i++)
            {
                tstr += (i+1) + ". " + p[i].padName + "\n";
            }
            if(!window.confirm(tstr))return;
            for(var i = 0; i < p.length; i++)
            {
                if(window.confirm("Open " + (i+1) + ". " + p[i].padName + "?"))
                {
                    window.openBoard(p[i].padGroupId,p[i].padName,r[0].id);
                    return "https://draw-lb.craniumcafe.com/d/" + p[i].padGroupId + "?uid=8209357&fullname=Mathnasium&owner_userid=1205645&meeting_id=1780524&room_title=wb&no_wrapper=0&m=1&allow_lock=0&allow_close=1&auth_" + "&room=" + encodeURI(r[0].name);
                }
            }
        }
        else
            window.alert("No whiteboard found with " + t);
    }
};

window.makeRoomsFromExcel = function()
{
	var t = window.promptBox("Copy and paste a list of rooms from spreadsheet:<br><br><textarea cols=45 rows=10 id='custompromptboxinput'></textarea>",function(){
        var rooms = [];
        function treat(s){return s.join(" ").replace(/\ +/g," ").trim()};
        document.getElementById('custompromptboxinput').value.split('\n').forEach(r1=>{
            console.log(r1);
            var idn = r1.split('\t');
            if(!idn[0])idn.shift();
            var rm0 = idn.slice(0,4);
            var rm1 = idn.slice(5);
            if(rm0[0] && rm0[1] && rm0[2])
                rooms.push(treat(rm0));
            if(rm1[0] && rm1[1] && rm1[2])
                rooms.push(treat(rm1));
        });
        rooms.forEach(r => window.addRoom(r));
    });
};





